import React from 'react';
import ProductCard from './ProductCard';

const products = [
  { id: 1, name: 'Camiseta Oversize', price: 25, image: 'https://via.placeholder.com/200x250' },
  { id: 2, name: 'Pantalón Cargo', price: 45, image: 'https://via.placeholder.com/200x250' },
  { id: 3, name: 'Chaqueta Urbana', price: 65, image: 'https://via.placeholder.com/200x250' },
  { id: 4, name: 'Zapatillas Street', price: 70, image: 'https://via.placeholder.com/200x250' },
];

function ProductList() {
  return (
    <section style={styles.container}>
      {products.map(product => (
        <ProductCard key={product.id} product={product} />
      ))}
    </section>
  );
}

const styles = {
  container: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    padding: '2rem',
  }
};

export default ProductList;
